import React from "react";
import { BrowserRouter,Routes, Route} from "react-router-dom";
import './App.css';
import Footer from './MainContent/Footer/Footer.js'
import Body from './MainContent/Body/Body.js';
import Navbar from './MainContent/Navbar/Navbar.js';
import DoctorDetails from './components/DoctorDetails.js';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Body />

        <Routes>
          <Route path="/" component={Body}></Route>
          <Route path="/DoctorDetails" component={DoctorDetails}></Route>
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
